#! /bin/sh
# echo architecture and OS name in upper case. Do NOT remove these two lines uname -s | tr '[:lower:]' '[:upper:]' [ -x "`which dpkg`" ] && dpkg --print-architecture | tr a-z A-Z
[ -f /etc/RUNNING_FROM_FAICD ] && echo "FAICD" exit 0

#! /bin/sh

# assign classes by hosts

# first, common classes.
echo -n "FAIBASE GRUB DHCPC DEMO ";

# detect whether this is physical, or virtual hardware. look for Bochs in the bios.
BOCHS=`dmidecode | grep Bochs`;
if [ ! -z "$BOCHS" ]; then
    echo -n "QEMUCLIENT ";
else
    # ok, look for SeaBIOS in the bios?
    SEABIOS=`dmidecode | grep SeaBIOS`;
    if [ ! -z "$SEABIOS" ]; then
	echo -n "QEMUCLIENT ";
    else
	# alrgiht, look at lscpu output.
	HYPERVISOR=`lscpu | grep Hypervisor`
	if [ ! -z "$HYPERVISOR" ]; then
	    echo -n "QEMUCLIENT ";
	else
	    echo -n "HWPHYS ";
	fi
    fi
fi

# detect running on AMD64 CPUs, even when booted in i386 mode.
OPMODES=`lscpu | sed -n "/CPU op/s/CPU op.*: *//p"`
if [ ! -z "$OPMODES" ]; then
    if [ "$OPMODES" = "32-bit, 64-bit" ]; then
	echo -n "HWAMD64 ";
    else
	echo -n "HW686 "
    fi
fi

# use the hostname to set a list of classes. last one wins.
case $HOSTNAME in
	faiserver)
		echo -n "JADMIN DEVHOST SERVERFAI JUSER" ;;
	qemuhost)
		echo -n "JADMIN DEVHOST SERVERFTP SERVERDHCP SERVERDHCPBOOT SERVERDNS HWPHYS SERVERSNMP SERVERWWW SERVERWWWMRTG SERVERQEMU SERVERQEMUDEV SERVERCREATEVM SERVERCREATEVMDEV SERVERWWWCREATEVM" ;;
	wikiserver)
		echo -n "JADMIN JUSER SERVERSNMP SERVERWIKI SERVERWWW" ;;
	awikiserver)
		echo -n "JADMIN JUSER SERVERSNMP SERVERWIKIMEDIA SERVERWWW SERVERMYSQL" ;;
	wordserver)
		echo -n "JADMIN SERVERSNMP SERVERMYSQL SERVERWWW SERVERWWWSSL SERVERWWWPHP5 SERVERWORDPRESS SERVERFTP" ;;
	drupalserver)
		echo -n "JADMIN SERVERSNMP SERVERMYSQL SERVERWWW SERVERWWWSSL SERVERWWWPHP5 SERVERDRUPAL" ;;
	postserver)
		echo -n "JADMIN JUSER HASUNTRUSTEDDATA SERVERMAIL SERVERMAILPARANOID" ;;
	giftserver)
		echo -n "JADMIN DEVHOST JUSER SERVERSNMP GIFTDEV SERVERGIFT SERVERWWW SERVERWWWPHP5 SERVERWWWGIFT" ;;
	oemrserver)
		echo -n "JADMIN DEVHOST SERVERSNMP SERVERMYSQL SERVERWWW SERVERWWWPHP5 SERVERWWWOEMR SERVERWWWSSL SERVERWWWSSLONLY" ;;
	lampserver)
		echo -n "JADMIN SERVERSNMP SERVERMYSQL SERVERWWW SERVERWWWSSL SERVERWWWPHP5" ;;
	kalliserver)
		echo -n "JADMIN SERVERSNMP SERVERMYSQL SERVERMAIL SERVERKALLI KALLIDEV" ;;

	implicitserver)
		echo -n "JADMIN JUSER SERVERWWW SERVERSNMP SERVERRORAILS SERVERIMPLICIT" ;;
	zonehost)
		echo -n "JADMIN SERVERSNMP SERVERWWW SERVERMYSQL SERVERWWWMRTG SERVERZONEMINDER ISCSICLIENT" ;;
	diskhost)
		echo -n "JADMIN JUSER SERVERSNMP SERVERWWW SERVERWWWMRTG SERVERISCSI" ;;
        pronterhost)
		echo -n "JADMIN DEVHOST JUSER SERVERREPRAP" ;;
	stephost)
		echo -n "JADMIN XORG JUSER HOSTSTEP" ;;
	steptop)

echo -n "JADMIN XORG HOSTSTEP QEMUDEV JUSER LAPTOP" ;;
	boxhost)
		echo -n "JADMIN XORG JUSER HOSTBOX" ;;
	boxtop)
		echo -n "JADMIN XORG HOSTBOX QEMUDEV JUSER LAPTOP" ;;
	nullhost)
		echo -n "JADMIN JUSER" ;;
	betahost)
		echo -n "JADMIN XORG HOSTSTEP QEMUDEV JUSER SERVERWIKI SERVERWWW SERVERWWWPHP5 DEVHOST SERVERFAI" ;;
esac

# add a carriage return to this script's output.
echo

exit 0

